import React from "react";
import { connect } from "react-redux";

class ItineraryDetails extends React.Component {
  render() {
    return (
      <div>
        <h1>Details Dummy</h1>
        {/* {console.log("store id value:", this.props.itinerary[0]._id)} */}
        {console.log(this.props.itinerary)}
        <p>{this.props.itinerary.title}</p>
      </div>
    );
  }
}

// grab cities from redux-store-state and save as params here under this.props.itinerary
const mapStateToProps = (state, ownProps) => {
  return {
    itinerary: state.itineraries.find(function(itinerary) {
      return itinerary._id === state.itineraries[ownProps.match.params.id];
    })
  };
};

// const mapStateToProps = state => {
